    false,nt"url": null,nt"notes": "This is the final report to the U.S. Fish
    and Wildlife Service for a site visit to determine the need of a biological assessment
    for Hailstone and Halfbreed National Wildlife Refuges (NWR) located in Lake Basin,
    Stillwater County, Montana. The FWS is faced with 2 potentially confounding issues
    in Lake Basin: 1) The influence of excessive solute accumulations in Hailstone reservoir
    on long-term FWS wetland management in Lake Basin and 2) How the water-control structure
    planned for Halfbreed NWR can be managed to meet long-term FWS objectives for migratory
    bird habitat in Lake Basin. Other issues that affect FWS management options relate
    to current and future impacts on surrounding lands owned by the state of Montana
    and private landowners.",nt"license_title": "License Not Specified",nt"extras":
